const image = new Image();
image.src = 'data:image/png;base64,';
const canvas = document.getElementById('canvas1');
let mainSectionHeight = document.querySelector('#main').offsetHeight

// ДОПИСАТЬ АДАПТИВ ДЛЯ МОБИЛОК

function me(){
    
    const ctx = canvas.getContext('2d',{ willReadFrequently: true });
    canvas.width = canvas.offsetWidth;
    canvas.height = canvas.offsetHeight;

    let particlesArray = [];
    const numberOfParticles = 2000;
    const detail = 1;

    ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    
    let grid = [];
    for (let y = 0; y < canvas.height; y += detail){
        let row = [];
        for (let x = 0; x < canvas.width; x += detail){
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]
            const brightness = calculateBrightness(red, green, blue)/100;

            row.push(brightness);
        }  
        grid.push(row); 
    }
    class Particle {
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y =  0;
            this.speed = 0;
            this.velocity = Math.random() * 0.7;
            this.size = Math.random() * 1.2 + .1;
        }
        update () {
            this.speed = grid[Math.floor(this.y / detail)][Math.floor(this.x / detail)];
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw(){
            ctx.beginPath();
            ctx.fillStyle = 'rgba(181, 97, 255,1)';
            ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
            ctx.fill();

        }
    }
    function init(){
        for (let i = 0; i < numberOfParticles; i++){
            particlesArray.push(new Particle());
        }
    }
    init();
    function animate () {
        if (window.scrollY > (mainSectionHeight - 100)) {
            animate = null;
            return
        }
        ctx.globalAlpha = 0.8;
        ctx.fillStyle = 'rgb(25, 24, 32)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.4;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * .7;
            particlesArray[i].draw();
        }
        requestAnimationFrame( animate );
        
    }
    animate();
    function calculateBrightness(red, green, blue){
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
            );
        }
}

